import React, { useState } from 'react';
import './ContactUs.css';

const ContactUsForm = () => {
  // Step 1: Customer Info
  const [formData, setFormData] = useState({
    fullName: '',
    phoneNumber: '',
    email: '',
    address: '',
  });

  // Step 2: Wedding Info
  const [weddingDetails, setWeddingDetails] = useState({
    weddingDate: '',
    weddingCity: '',
    brideName: '',
    groomName: '',
    numberOfGuests: '',
    eventDuration: '',
  });

  // To handle steps
  const [currentStep, setCurrentStep] = useState(1);

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (currentStep === 1) {
      setFormData({
        ...formData,
        [name]: value,
      });
    } else if (currentStep === 2) {
      setWeddingDetails({
        ...weddingDetails,
        [name]: value,
      });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (currentStep === 1) {
      setCurrentStep(2); // Move to wedding details
    } else if (currentStep === 2) {
      console.log("Form Submitted", { ...formData, ...weddingDetails });
      // You can send this data to a backend or perform other actions
    }
  };

  // Handle the "Previous" button to go back to the previous step
  const handlePrevious = () => {
    setCurrentStep(1); // Go back to step 1
  };

  return (
    <div className="form-container">
      <h2>We are delighted you are here! Tell us about yourself</h2>
      <form onSubmit={handleSubmit}>
        {currentStep === 1 && (
          <div className="form-section">
            <h3>Step 1: Customer Information</h3>

            <div className="form-group">
              <label htmlFor="fullName">Full Name:</label>
              <input
                type="text"
                id="fullName"
                name="fullName"
                value={formData.fullName}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="phoneNumber">Phone Number:</label>
              <input
                type="text"
                id="phoneNumber"
                name="phoneNumber"
                value={formData.phoneNumber}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="email">Email Address:</label>
              <input
                type="email"
                id="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="address">Address:</label>
              <input
                type="text"
                id="address"
                name="address"
                value={formData.address}
                onChange={handleChange}
                required
              />
            </div>

            <button type="submit">Next Step</button>
          </div>
        )}

        {currentStep === 2 && (
          <div className="form-section">
            <h3>Step 2: Wedding Details</h3>

            <div className="form-group">
              <label htmlFor="weddingDate">Wedding Date:</label>
              <input
                type="date"
                id="weddingDate"
                name="weddingDate"
                value={weddingDetails.weddingDate}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="weddingCity">Wedding City:</label>
              <input
                type="text"
                id="weddingCity"
                name="weddingCity"
                value={weddingDetails.weddingCity}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="brideName">Bride's Name:</label>
              <input
                type="text"
                id="brideName"
                name="brideName"
                value={weddingDetails.brideName}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="groomName">Groom's Name:</label>
              <input
                type="text"
                id="groomName"
                name="groomName"
                value={weddingDetails.groomName}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="numberOfGuests">Number of Guests:</label>
              <input
                type="number"
                id="numberOfGuests"
                name="numberOfGuests"
                value={weddingDetails.numberOfGuests}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="eventDuration">Event Duration (in days):</label>
              <input
                type="number"
                id="eventDuration"
                name="eventDuration"
                value={weddingDetails.eventDuration}
                onChange={handleChange}
                required
              />
            </div>

            <button type="submit">Submit</button>
            <button type="button" onClick={handlePrevious}>Previous Step</button>
          </div>
        )}
      </form>
    </div>
  );
};

export default ContactUsForm;
